import React from 'react';
import { Link } from 'react-router-dom';

class Home extends React.Component {
  render() {
    return (
      <div>
        Bem-vindo ao sistema de cadastramento!
        <Link to="/components/LogInPages">LogIn</Link>
      </div>
    )
  }
}

export default Home;
